                new Movie {Id = 27, DirectorId = 22, GenreId = 1, Title = "Booksmart", Description = "Academic overachievers Amy and Molly thought keeping their noses to the grindstone gave them a leg up on their high school peers. But on the eve of graduation, the best friends suddenly realize that they may have missed out on the special moments of their teenage years. Determined to make up for lost time, the girls decide to cram four years of not-to-be missed fun into one night -- a chaotic adventure that no amount of book smarts could prepare them fo", Year = 1978, IsForeign = false, Length = "102min", Rating = "4.9/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV," },
                new Movie {Id = 28, DirectorId = 23, GenreId = 1, Title = "Year One", Description = "After Neanderthal hunter Zed (Jack Black) is exiled for eating forbidden fruit, he and his sardonic buddy Oh (Michael Cera) leave their village and begin an epic journey through history. The pals encounter biblical characters such as Cain (David Cross) and Abel, Abraham (Hank Azaria), and others, and wind up in Sodom. Along the way, Zed debunks commonly held beliefs and replaces them with his own delusions of grandeur.", Year = 2009, IsForeign = false, Length = "97min", Rating = "2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV," },
