                new Movie {Id = 30, DirectorId = 16, GenreId = 1, Title = "The Interview", Description = "Dave Skylark (James Franco) and his producer Aaron Rapoport (Seth Rogen) are the team behind the popular tabloid-TV show \"Skylark Tonight.\" After learning that North Korea's Kim Jong Un (Randall Park) is a huge fan of the show, they successfully set up an interview with him, hoping to legitimize themselves as actual journalists. However, as Dave and Aaron prepare for their journey to Pyongyang, the CIA steps in, recruits them, and assigns them an incredible mission: Assassinate the dictator.", Year = 2014, IsForeign = false, Length = "112min", Rating = "2.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV," },
                new Movie {Id = 31, DirectorId = 12, GenreId = 8, Title = "Paul", Description = "For the past 60 years, a wisecracking alien named Paul (Seth Rogen) has resided at a top-secret military base in America's UFO heartland. When Paul decides he has had enough of Earth, he escapes from the compound and hops on the first handy vehicle -- a rented RV manned by two British sci-fi nerds named Graeme (Simon Pegg) and Clive (Nick Frost). With federal agents and the father of an accidental kidnap victim on their tail, the two hatch a crazy plan to help Paul return to his spaceship.", Year = 2011, IsForeign = false, Length = "110min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV," },
                new Movie {Id = 32, DirectorId = 24, GenreId = 1, Title = "Drillbit Taylor", Description = "For three misfit freshmen, the first day of high school becomes a living hell when Filkins (Alex Frost), the school bully, zeroes in on them. Chubby Ryan (Troy Gentile), diminutive Emmit (David Dorfman) and skinny Wade (Nate Hartley) all feel the wrath of Filkins. Realizing that their own chance for survival is to hire a bodyguard, the pals place an ad in the newspaper. Answering the call is Drillbit Taylor (Owen Wilson) ; armed, dangerous and completely fake.", Year = 2008, IsForeign = false, Length = "110min", Rating = "2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Hulu, Pluto TV, Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV," },
                new Movie {Id = 33, DirectorId = 25, GenreId = 1, Title = "21 Jump Street", Description = "When cops Schmidt (Jonah Hill) and Jenko (Channing Tatum) join the secret Jump Street unit, they use their youthful appearances to go under cover as high-school students. They trade in their guns and badges for backpacks, and set out to shut down a dangerous drug ring. But, as time goes on, Schmidt and Jenko discover that high school is nothing like it was just a few years earlier -- and, what's more, they must again confront the teenage terror and anxiety they thought they had left behind.", Year = 2012, IsForeign = false, Length = "109min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Sling, Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV," },
                new Movie {Id = 34, DirectorId = 26, GenreId = 2, Title = "Bridesmaids", Description = "Annie (Kristen Wiig) is a single woman whose own life is a mess, but when she learns that her lifelong best friend, Lillian (Maya Rudolph), is engaged, she has no choice but to serve as the maid of honor. Though lovelorn and almost penniless, Annie, nevertheless, winds her way through the strange and expensive rituals associated with her job as the bride's go-to gal. Determined to make things perfect, she gamely leads Lillian and the other bridesmaids down the wild road to the wedding.", Year = 2011, IsForeign = false, Length = "125min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock,Sling, Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV", },
                new Movie {Id = 35, DirectorId = 27, GenreId = 1, Title = "Blazing Saddles", Description = "In this satirical take on Westerns, crafty railroad worker Bart (Cleavon Little) becomes the first black sheriff of Rock Ridge, a frontier town about to be destroyed in order to make way for a new railroad. Initially, the people of Rock Ridge harbor a racial bias toward their new leader. However, they warm to him after realizing that Bart and his perpetually drunk gunfighter friend (Gene Wilder) are the only d", Year = 1974, IsForeign = false, Length = "93min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Showtime, Hulu, Fubu, Paramount, Peacock,Sling, Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV" },
                new Movie {Id = 36, DirectorId = 28, GenreId = 1, Title = "The Hangover", Description = "Two days before his wedding, Doug (Justin Bartha) and three friends (Bradley Cooper, Ed Helms, Zach Galifianakis) drive to Las Vegas for a wild and memorable stag party. In fact, when the three groomsmen wake up the next morning, they can't remember a thing; nor can they find Doug. With little time to spare, the three hazy pals try to re-trace their steps and find Doug so they can get him back to Los Angeles in time to walk down the aisle.", Year = 2009, IsForeign = false, Length = "96min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Vudu,  Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV" },
