                new Movie {Id = 38, DirectorId = 28, GenreId = 1, Title = "The Hangover Part III", Description = "It's been two years since the gang known as the Wolfpack narrowly escaped disaster in Bangkok. Now, Phil (Bradley Cooper), Stu (Ed Helms) and Doug (Justin Bartha) have happy lives at home -- but Alan (Zach Galifianakis) doesn't. Still lacking contentment and a sense of purpose, Alan has gone off his meds and surrendered to his natural impulses. It's up to the other members of the Wolfpack to get him through his personal crisis by embarking on a road trip to the place it all began: Las Vegas.", Year = 2013, IsForeign = false, Length = "100min", Rating = "2.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Vudu,  Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV" },
                new Movie {Id = 39, DirectorId = 29, GenreId = 1, Title = "Groundhog Day", Description = "A cynical TV weatherman finds himself reliving the same day over and over again when he goes on location to the small town of Punxsutawney to film a report about their annual Groundhog Day. His predicament drives him to distraction, until he sees a way of turning the situation to his advantage.", Year = 1993, IsForeign = false, Length = "101min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "The Roku Channel, Google Play Movies & TV, Netflix, Amazon Prime" },
                new Movie {Id = 40, DirectorId = 30, GenreId = 1, Title = "Dumb and Dumber", Description = "Imbecilic best friends Lloyd Christmas (Jim Carrey) and Harry Dunne (Jeff Daniels) stumble across a suitcase full of money left behind in Harry's car by Mary Swanson (Lauren Holly), who was on her way to the airport. The pair decide to go to Aspen, Colo., to return the money, unaware that it is connected to a kidnapping. As Harry and Lloyd -- who has fallen in love with Mary -- are pursued across the country by hired killers and police, they find both their friendship and their brains tested.", Year = 1994, IsForeign = false, Length = "113min", Rating = "3.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 41, DirectorId = 31, GenreId = 1, Title = "Dumb and Dumberer: When Harry Met Lloyd", Description = "After years of homeschooling, dim-bulb teen Harry Dunne (Derek Richardson) finally makes the leap to public school and meets the equally intellectually challenged Lloyd Christmas (Eric Christian Olsen). The duo land in a \"special needs\" class created by Principal Collins (Eugene Levy) in order to bilk money from parents to fund his condo in Waikiki, Hawaii. His corruption is discovered by Jessica (Rachel Nichols), a fellow student who asks Harry and Lloyd to help her prove Collins' guilt.", Year = 2003, IsForeign = false, Length = "85min", Rating = "1/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 42, DirectorId = 30, GenreId = 1, Title = "Dumb and Dumber To", Description = "In need of a new kidney and having learned that he has a long-lost daughter, dimwit Harry Dunne (Jeff Daniels) snaps his equally cretinous pal, Lloyd Christmas (Jim Carrey), out of an apparent fugue state to accompany him on a journey to find her. The witless wonders criss-cross the country using whatever mode of transportation they can find, ultimately arriving at the one place on Earth where they least belong: a summit of the world's most brilliant minds", Year = 2014, IsForeign = false, Length = "109min", Rating = "2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 43, DirectorId = 32, GenreId = 1, Title = "Shaun of the Dead", Description = "Shaun is a 30-something loser with a dull, easy existence. When he's not working at the electronics store, he lives with his slovenly best friend, Ed, in a small flat on the outskirts of London. The only unpredictable element in his life is his girlfriend, Liz, who wishes desperately for Shaun to grow up and be a man. When the town is inexplicably overrun with zombies, Shaun must rise to the occasion and protect both Liz and his mother.", Year = 2004, IsForeign = false, Length = "97min", Rating = "3.9/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Hulu, Peacock, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 44, DirectorId = 30, GenreId = 2, Title = "There's Something About Mary", Description = "Ted's (Ben Stiller) dream prom date with Mary (Cameron Diaz) never happens due to an embarrassing injury at her home. Years later, Ted hires Pat Healy (Matt Dillon) to track down Mary so he can reconnect with her. Pat lies to Ted about Mary and he finds out everything he can about her to trick her into dating him. Ted travels to meet Mary and has to weave through the web of lies that Pat and Mary's friend Tucker (Lee Evans) have woven to try and win her over.", Year = 1998, IsForeign = false, Length = "130min", Rating = "4.1/5", Rated = "R", ImgUrl = "/data:image/jpeg;base64,", SteamingOn = "FXNOW, Hulu, Peacock, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 45, DirectorId = 33, GenreId = 1, Title = "Rush Hour", Description = "When a Chinese diplomat's daughter is kidnapped in Los Angeles, he calls in Hong Kong Detective Inspector Lee (Jackie Chan) to assist the FBI with the case. But the FBI doesn't want anything to do with Lee, and they dump him off on the LAPD, who assign wisecracking Detective James Carter (Chris Tucker) to watch over him. Although Lee and Carter can't stand each other, they choose to work together to solve the case on their own when they figure out they've been ditched by both the FBI and police.", Year = 1998, IsForeign = false, Length = "97min", Rating = "3.2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 46, DirectorId = 33, GenreId = 1, Title = "Rush Hour 2", Description = "After an explosion at the US Embassy in Hong Kong kills two customs agents investigating currency smuggling, Inspector Lee (Jackie Chan) and James Carter (Chris Tucker) search for the mastermind. Ricky Tan (John Lone), head of the Fu-Cang-Long Triad, sends out his minions to insure that Carter and Lee don't solve the case.", Year = 2001, IsForeign = false, Length = "90min", Rating = "3.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 47, DirectorId = 33, GenreId = 1, Title = "Rush Hour 3", Description = "East meets West again when the assassination of Ambassador Han leads to the reunion of Lee (Jackie Chan) and Carter (Chris Tucker). In Paris, the pair must stay one step ahead of Chinese gangsters, and Lee's childhood friend (Hiroyuki Sanada), as they track down an envelope containing the identity of a powerful crime lord.", Year = 2007, IsForeign = false, Length = "91min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 48, DirectorId = 33, GenreId = 1, Title = "Money Talks", Description = "Reporter James (Charlie Sheen) brings petty crook Franklin (Chris Tucker) to justice, but as Franklin is being taken to jail, he is unwittingly drawn into a violent prison break. The police pursue Franklin, mistakenly thinking he killed several officers, so the fugitive turns to James for help. Figuring he has stumbled upon the story of a lifetime, the journalist agrees to prove that Franklin is innocent. Unfortunately, things don't go smoothly, and both men find themselves on the run.", Year = 1997, IsForeign = false, Length = "97min", Rating = "3.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 49, DirectorId = 34, GenreId = 1, Title = "Coming to America", Description = "Prince Akeem (Eddie Murphy) is the prince of a wealthy African country and wants for nothing, except a wife who will love him in spite of his title. To escape an arranged marriage, Akeem flees to America accompanied by his persnickety sidekick, Semmi (Arsenio Hall), to find his queen. Disguised as a foreign student working in fast food, he romances Lisa (Shari Headley), but struggles with revealing his true identity to her and his marital intentions to his king father (James Earl Jones).", Year = 1988, IsForeign = false, Length = "116min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 50, DirectorId = 35, GenreId = 1, Title = "The Nutty Professor", Description = "Brilliant and obese scientist Sherman Klump (Eddie Murphy) invents a miraculous weight-loss solution. After a date with chemistry student Carla Purty (Jada Pinkett) goes badly, a depressed Klump tries the solution on himself. Though he instantly loses 250 pounds, the side effects include a second personality: an obnoxiously self-assertive braggart who calls himself Buddy Love. Buddy proves to be more popular than Sherman, but his arrogance and bad behavior quickly spiral out of control.", Year = 1996, IsForeign = false, Length = "95min", Rating = "2.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 51, DirectorId = 36, GenreId = 1, Title = "Nutty Professor II: The Klumps", Description = "A guy is getting married, but his alter-ego keeps breaking through. Determined to rid himself of his pesky partner, he extracts his alter-ego's genes, but an accident and a dog hair see the later-ego take on his own life. Unaware of his existence, the man and his wife perfect their new rejuvenation formula and their fortune seems assured until his alter-ego steals it.", Year = 2000, IsForeign = false, Length = "106min", Rating = "2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 52, DirectorId = 37, GenreId = 1, Title = "Life", Description = "During Prohibition, loudmouth Harlem grifter Ray (Eddie Murphy) and the no-nonsense Claude (Martin Lawrence) team up on a bootlegging mission to Mississippi that could bring them big bucks. But they run into trouble when a crooked lawman hits them with a phony murder charge. Ray and Claude are given life sentences and shipped off to jail, where they must think of a way to prove their innocence and avoid the brutal guards while battling their biggest enemies -- their opposing personalities.", Year = 1999, IsForeign = false, Length = "108min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu, Peacock" },
                new Movie {Id = 53, DirectorId = 39, GenreId = 1, Title = "Beverly Hills Cop", Description = "After his childhood buddy is murdered while visiting Detroit, rebellious cop Axel Foley (Eddie Murphy) follows the leads to Beverly Hills, Calif., under the auspices of a vacation. He checks in with old friend Jenny Summers (Lisa Eilbacher) and starts to believe her boss, art dealer Victor Maitland (Steven Berkoff), might somehow be involved in the murder. However, Lt. Bogomil (Ronny Cox) of the Beverly Hills Police Department does not trust Foley, and hinders his search for evidence.", Year = 1984, IsForeign = false, Length = "105min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Showtime, Paramount, fuboTV, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu," },
                new Movie {Id = 54, DirectorId = 40, GenreId = 1, Title = "Beverly Hills Cop II", Description = "The hard-nosed Detroit cop from the original film returns to Los Angeles to help solve another case. This time he must direct his efforts towards unravelling the Alphabet Crimes, a series of robberies committed by leather-jacketed punks. The investigation puts him on the trail of an illegal arms dealer and his hit lady.", Year = 1987, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Showtime, Paramount, fuboTV, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu," },
                new Movie {Id = 55, DirectorId = 34, GenreId = 1, Title = "Beverly Hills Cop III", Description = "When his boss is killed, Detroit cop Alex Foley (Eddie Murphy) finds evidence that the murderer had ties to a California amusement park called Wonder World. Returning to Beverly Hills once more, Foley reunites with Detective Billy Rosewood (Judge Reinhold) to solve the case. Along with Billy's new partner, Jon Flint (Héctor Elizondo), they discover that the security force of Wonder World is actually part of a counterfeit money operation headed by park manager Orrin Sanderson (John Saxon).", Year = 1994, IsForeign = false, Length = "105min", Rating = "2.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Hulu, Showtime, Paramount, fuboTV, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu," },
                new Movie {Id = 56, DirectorId = 41, GenreId = 1, Title = "House Party", Description = "Play's parents are out of town, and he's planning the house party to end all house parties. His best friend, Kid, wants to go more than anything, knowing Sydney (Tisha Campbell-Martin), the hottest girl in school, is sure to be there. But when Kid gets into a fight at school, his father grounds him. Still determined to go, Kid sneaks out of the house and faces one calamity after another as he makes his way to Play's house and the party of the school year.", Year = 1990, IsForeign = false, Length = "100min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Google Play Movies & YV, Apple TV, Vudu, Tubi" },
                new Movie {Id = 57, DirectorId = 42, GenreId = 1, Title = "House Party 2", Description = "Rapper-turned-scholar Kid (Christopher Reid) gets into college, but he runs out of cash just as classes start. Desperate for dough, he tries working in the cafeteria, but when his time spent serving slop to students starts to interfere with studying and his relationship with girlfriend Sidney (Tisha Campbell), he looks for a new plan. He calls up his old partner in partying, Play (Christopher Martin), and they organize a pajama shindig, where women dress scantily and men must pay to enter.", Year = 1991, IsForeign = false, Length = "94min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Google Play Movies & YV, Apple TV, Vudu, Tubi" },
                new Movie {Id = 58, DirectorId = 43, GenreId = 1, Title = "House Party 3", Description = "After more than their share of exploits, best friends Kid and Play (Christopher Reid, Christopher Martin) are growing up: Kid is marrying his girlfriend, Veda, and Play is trying to survive in the music business. But they face major hurdles in their maturation process. While Play plans a bachelor party, handles some raucous younger cousins and deals with the arrival in town of Kid's ex-girlfriend, he also tries to bring success to a new female rap group called Sex as a Weapon.", Year = 1994, IsForeign = false, Length = "104min", Rating = "2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Google Play Movies & YV, Apple TV, Vudu, Tubi" },
                new Movie {Id = 59, DirectorId = 44, GenreId = 1, Title = "House Party 4: Down to the Last Minute", Description = "Teenager Jon Jon Harris (Marques Houston) just can't seem to help throwing a party after he volunteers to house-sit his wealthy uncle's spacious home. In addition to throwing the bash, the ever-ambitious Jon Jon also decides to audition for a record deal with his rhythm-and-blues ensemble, which includes two of his close friends. The group performs and the party rages, but Jon Jon is in for a surprise when he finds out that his uncle is returning sooner rather than later.", Year = 2001, IsForeign = false, Length = "94min", Rating = "2.5/5", Rated = "R", ImgUrl = "/data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Google Play Movies & TV, Apple TV, Vudu, Tubi" },
                new Movie {Id = 60, DirectorId = 45, GenreId = 1, Title = "House Party", Description = "Aspiring club promoters and best buddies Damon and Kevin are barely keeping things together. Out of money, down on their luck and about to lose the roofs over their heads, they need a huge windfall to make their problems go away. They soon decide to host the party of the year at an exclusive mansion, which just happens to belong to none other than NBA superstar LeBron James.", Year = 2023, IsForeign = false, Length = "101min", Rating = "1.8/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Max, Hulu Tubi, YouTube, Vude, Redbox, Apple TV, Google Play Movies & TV" },
                new Movie {Id = 61, DirectorId = 46, GenreId = 3, Title = "The Silence of the Lambs", Description = "Jodie Foster stars as Clarice Starling, a top student at the FBI's training academy. Jack Crawford (Scott Glenn) wants Clarice to interview Dr. Hannibal Lecter (Anthony Hopkins), a brilliant psychiatrist who is also a violent psychopath, serving life behind bars for various acts of murder and cannibalism. Crawford believes that Lecter may have insight into a case and that Starling, as an attractive young woman, may be just the bait to draw him out.", Year = 1991, IsForeign = false, Length = "118min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Max, Hulu Tubi, YouTube, Vude, Redbox, Apple TV, Google Play Movies & TV" },
                new Movie {Id = 62, DirectorId = 47, GenreId = 3, Title = "Seven", Description = "When retiring police Detective William Somerset (Morgan Freeman) tackles a final case with the aid of newly transferred David Mills (Brad Pitt), they discover a number of elaborate and grizzly murders. They soon realize they are dealing with a serial killer (Kevin Spacey) who is targeting people he thinks represent one of the seven deadly sins. Somerset also befriends Mills' wife, Tracy (Gwyneth Paltrow), who is pregnant and afraid to raise her child in the crime-riddled city.", Year = 1978, IsForeign = false, Length = "127min", Rating = "4.6/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Hulu Tubi, YouTube, Vude, Redbox, Apple TV, Google Play Movies & TV" },
                new Movie {Id = 63, DirectorId = 48, GenreId = 3, Title = "Vertigo", Description = "An ex-police officer who suffers from an intense fear of heights is hired to prevent an old friend's wife from committing suicide, but all is not as it seems. Hitchcock's haunting, compelling masterpiece is uniquely revelatory about the director's own predilections and hang-ups and is widely considered to be one of his masterworks.", Year = 1958, IsForeign = false, Length = "129min", Rating = "4/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "YouTube, Vudu, Redbox, Apple TV, Google Play Movies & TV, AMC,Sling TV, Philo " },
                new Movie {Id = 64, DirectorId = 49, GenreId = 3, Title = "Memento", Description = "Leonard (Guy Pearce) is tracking down the man who raped and murdered his wife. The difficulty, however, of locating his wife's killer is compounded by the fact that he suffers from a rare, untreatable form of memory loss. Although he can recall details of life before his accident, Leonard cannot remember what happened fifteen minutes ago, where he's going, or why.", Year = 2000, IsForeign = false, Length = "113min", Rating = "4.4/5", Rated = "R", ImgUrl = "/data:image/jpeg;base64,", SteamingOn = "Plex, Tubi, YouTube, Vudu, Redbox, Apple TV, Google Play Movies & TV " },
                new Movie {Id = 65, DirectorId = 48, GenreId = 5, Title = "Psycho", Description = "Phoenix secretary Marion Crane (Janet Leigh), on the lam after stealing $40,000 from her employer in order to run away with her boyfriend, Sam Loomis (John Gavin), is overcome by exhaustion during a heavy rainstorm. Traveling on the back roads to avoid the police, she stops for the night at the ramshackle Bates Motel and meets the polite but highly strung proprietor Norman Bates (Anthony Perkins), a young man with an interest in taxidermy and a difficult relationship with his mother.", Year = 1960, IsForeign = false, Length = "109min", Rating = "4.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, AMC,Plex, Tubi, YouTube, Vudu, Redbox, Apple TV, Google Play Movies & TV, Sling TV " },
                new Movie {Id = 66, DirectorId = 50, GenreId = 11, Title = "Shutter Island", Description = "The implausible escape of a brilliant murderess brings U.S. Marshal Teddy Daniels (Leonardo DiCaprio) and his new partner (Mark Ruffalo) to Ashecliffe Hospital, a fortress-like insane asylum located on a remote, windswept island. The woman appears to have vanished from a locked room, and there are hints of terrible deeds committed within the hospital walls. As the investigation deepens, Teddy realizes he will have to confront his own dark fears if he hopes to make it off the island alive.", Year = 1978, IsForeign = false, Length = "138min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, FuboTV, YouTube, Vudu, Redbox, Apple TV, Google Play Movies & TV, Sling TV" },
                new Movie {Id = 67, DirectorId = 49, GenreId = 8, Title = "Inception", Description = "Dom Cobb (Leonardo DiCaprio) is a thief with the rare ability to enter people's dreams and steal their secrets from their subconscious. His skill has made him a hot commodity in the world of corporate espionage but has also cost him everything he loves. Cobb gets a chance at redemption when he is offered a seemingly impossible task: Plant an idea in someone's mind. If he succeeds, it will be the perfect crime, but a dangerous enemy anticipates Cobb's every move.", Year = 1978, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, YouTube, Vudu, Redbox, Apple TV, Google Play Movies & TV" },
                new Movie {Id = 68, DirectorId = 48, GenreId = 3, Title = "Rear Window", Description = "The story of a recuperating news photographer who believes he has witnessed a murder. Confined to a wheelchair after an accident, he spends his time watching the occupants of neighbouring apartments through a telephoto lens and binoculars and becomes convinced that a murder has taken place.", Year = 1954, IsForeign = false, Length = "112min", Rating = "4.5/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Sling TV, Amazon Prime, YouTube, Vudu, Redbox, Apple TV, Google Play Movies & TV" },
                new Movie {Id = 69, DirectorId = 51, GenreId = 3, Title = "Oldboy", Description = "Dae-Su is an obnoxious drunk bailed from the police station yet again by a friend. However, he's abducted from the street and wakes up in a cell, where he remains for the next 15 years, drugged unconscious when human contact is unavoidable, otherwise with only the television as company. And then, suddenly released, he is invited to track down his jailor with a denouement that is simply stunning.", Year = 2003, IsForeign = false, Length = "132min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 70, DirectorId = 47, GenreId = 3, Title = "Zodiac", Description = "In the late 1960s and 1970s, fear grips the city of San Francisco as a serial killer called Zodiac stalks its residents. Investigators (Mark Ruffalo, Anthony Edwards) and reporters (Jake Gyllenhaal, Robert Downey Jr.) become obsessed with learning the killer's identity and bringing him to justice. Meanwhile, Zodiac claims victim after victim and taunts the authorities with cryptic messages, cyphers and menacing phone calls.", Year = 2007, IsForeign = false, Length = "160min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Showtime, Hulu, " },
                new Movie {Id = 71, DirectorId = 47, GenreId = 3, Title = "Gone Girl", Description = "In Carthage, Mo., former New York-based writer Nick Dunne (Ben Affleck) and his glamorous wife Amy (Rosamund Pike) present a portrait of a blissful marriage to the public. However, when Amy goes missing on the couple's fifth wedding anniversary, Nick becomes the prime suspect in her disappearance. The resulting police pressure and media frenzy cause the Dunnes' image of a happy union to crumble, leading to tantalizing questions about who Nick and Amy truly are.", Year = 2014, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Max, Hulu" },
                new Movie {Id = 72, DirectorId = 49, GenreId = 3, Title = "The Prestige", Description = "Period thriller set in Edwardian London where two rival magicians, partners until the tragic death of an assistant during a show, feud bitterly after one of them performs the ultimate magic trick - teleportation. His rival tries desperately to uncover the secret of his routine, experimenting with dangerous new science as his quest takes him to the brink of insanity and jeopardises the lives of everyone around the pair", Year = 2006, IsForeign = false, Length = "130min", Rating = "3.7/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Max, Hulu" },
                new Movie {Id = 73, DirectorId = 55, GenreId = 3, Title = "Chinatown", Description = "When Los Angeles private eye J.J. \"Jake\" Gittes (Jack Nicholson) is hired by Evelyn Mulwray to investigate her husband's activities, he believes it's a routine infidelity case. Jake's investigation soon becomes anything but routine when he meets the real Mrs. Mulwray (Faye Dunaway) and realizes he was hired by an imposter. Mr. Mulwray's sudden death sets Gittes on a tangled trail of corruption, deceit and sinister family secrets as Evelyn's father (John Huston) becomes a suspect in the case.", Year = 1974, IsForeign = false, Length = "130min", Rating = "5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Max, MGM, Paramount, Roku Channel" },
                new Movie {Id = 74, DirectorId = 56, GenreId = 3, Title = "Black Swan", Description = "Nina (Natalie Portman) is a ballerina whose passion for the dance rules every facet of her life. When the company's artistic director decides to replace his prima ballerina for their opening production of \"Swan Lake,\" Nina is his first choice. She has competition in newcomer Lily (Mila Kunis) however. While Nina is perfect for the role of the White Swan, Lily personifies the Black Swan. As rivalry between the two dancers transforms into a twisted friendship, Nina's dark side begins to emerge", Year = 2010, IsForeign = false, Length = "108min", Rating = "4/5", Rated = "R", ImgUrl = "/data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 75, DirectorId = 57, GenreId = 3, Title = "The Manchurian Candidate", Description = "Near the end of the Korean War, a platoon of U.S. soldiers is captured by communists and brainwashed. Following the war, the platoon is returned home, and Sergeant Raymond Shaw (Laurence Harvey) is lauded as a hero by the rest of his platoon. However, the platoon commander, Captain Bennett Marco (Frank Sinatra), finds himself plagued by strange nightmares and, together with fellow soldier Allen Melvin (James Edwards), races to uncover a terrible plot", Year = 1978, IsForeign = false, Length = "103min", Rating = "3.5/5", Rated = "PG-3", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Sling TV" },
                new Movie {Id = 76, DirectorId = 46, GenreId = 3, Title = "The Manchurian Candidate", Description = "Years after his squad was ambushed during the Gulf War, Major Ben Marco (Denzel Washington) finds himself having terrible nightmares. He begins to doubt that his fellow squad-mate Sergeant Raymond Shaw (Liev Schreiber), now a vice-presidential candidate, is the hero he remembers him being. As Marco's doubts deepen, Shaw's political power grows, and, when Marco finds a mysterious implant embedded in his back, the memory of what really happened begins to return.", Year = 2004, IsForeign = false, Length = "129min", Rating = "4/5", Rated = "R", ImgUrl = "/data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 77, DirectorId = 49, GenreId = 4, Title = "The Dark Knight", Description = "With the help of allies Lt. Jim Gordon (Gary Oldman) and DA Harvey Dent (Aaron Eckhart), Batman (Christian Bale) has been able to keep a tight lid on crime in Gotham City. But when a vile young criminal calling himself the Joker (Heath Ledger) suddenly throws the town into chaos, the caped Crusader begins to tread a fine line between heroism and vigilantism.", Year = 1978, IsForeign = false, Length = "152min", Rating = "4.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "TNT, TBS, Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Max, Hulu" },
                new Movie {Id = 78, DirectorId = 50, GenreId = 11, Title = "Taxi Driver", Description = "Suffering from insomnia, disturbed loner Travis Bickle (Robert De Niro) takes a job as a New York City cabbie, haunting the streets nightly, growing increasingly detached from reality as he dreams of cleaning up the filthy city. When Travis meets pretty campaign worker Betsy (Cybill Shepherd), he becomes obsessed with the idea of saving the world, first plotting to assassinate a presidential candidate, then directing his attentions toward rescuing 12-year-old prostitute Iris (Jodie Foster).", Year = 1976, IsForeign = false, Length = "1114min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 79, DirectorId = 58, GenreId = 3, Title = "The Sixth Sense", Description = "Young Cole Sear (Haley Joel Osment) is haunted by a dark secret: he is visited by ghosts. Cole is frightened by visitations from those with unresolved problems who appear from the shadows. He is too afraid to tell anyone about his anguish, except child psychologist Dr. Malcolm Crowe (Bruce Willis). As Dr. Crowe tries to uncover the truth about Cole's supernatural abilities, the consequences for client and therapist are a jolt that awakens them both to something unexplainable.", Year = 1999, IsForeign = false, Length = "107min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 80, DirectorId = 59, GenreId = 3, Title = "Mulholland Drive", Description = "A dark-haired woman (Laura Elena Harring) is left amnesiac after a car crash. She wanders the streets of Los Angeles in a daze before taking refuge in an apartment. There she is discovered by Betty (Naomi Watts), a wholesome Midwestern blonde who has come to the City of Angels seeking fame as an actress. Together, the two attempt to solve the mystery of Rita's true identity. The story is set in a dream-like Los Angeles, spoilt neither by traffic jams nor smog.", Year = 1993, IsForeign = false, Length = "127min", Rating = "4.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Max, Hulu, Showtime, FuboTV" },
                new Movie {Id = 81, DirectorId = 59, GenreId = 3, Title = "The Fugitive", Description = "Wrongfully accused of murdering his wife, Richard Kimble (Harrison Ford) escapes from the law in an attempt to find her killer and clear his name. Pursuing him is a team of U.S. marshals led by Deputy Samuel Gerard (Tommy Lee Jones), a determined detective who will not rest until Richard is captured. As Richard leads the team through a series of intricate chases, he discovers the secrets behind his wife's death and struggles to expose the killer before it is too late.", Year = 1993, IsForeign = false, Length = "127min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Tubi" },
                new Movie {Id = 82, DirectorId = 48, GenreId = 3, Title = "North by Northwest", Description = "This classic suspense film finds New York City ad executive Roger O. Thornhill (Cary Grant) pursued by ruthless spy Phillip Vandamm (James Mason) after Thornhill is mistaken for a government agent. Hunted relentlessly by Vandamm's associates, the harried Thornhill ends up on a cross-country journey, meeting the beautiful and mysterious Eve Kendall (Eva Marie Saint) along the way. Soon Vandamm's henchmen close in on Thornhill, resulting in a number of iconic action sequences.", Year = 1959, IsForeign = false, Length = "136min", Rating = "4/5", Rated = "Not Rated", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV" },
                new Movie {Id = 83, DirectorId = 50, GenreId = 3, Title = "The Departed", Description = "South Boston cop Billy Costigan (Leonardo DiCaprio) goes under cover to infiltrate the organization of gangland chief Frank Costello (Jack Nicholson). As Billy gains the mobster's trust, a career criminal named Colin Sullivan (Matt Damon) infiltrates the police department and reports on its activities to his syndicate bosses. When both organizations learn they have a mole in their midst, Billy and Colin must figure out each other's identities to save their own lives.", Year = 2006, IsForeign = false, Length = "151min", Rating = "4.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV" },
                new Movie {Id = 84, DirectorId = 50, GenreId = 3, Title = "Cape Fear", Description = "When attorney Sam Bowden (Nick Nolte) knowingly withholds evidence that would acquit violent sex offender Max Cady (Robert De Niro) of rape charges, Max spends 14 years in prison. But after Max's release, knowing about Sam's deceit, he devotes his life to stalking and destroying the Bowden family. When practical attempts to stop Max fail, Sam realizes that he must act outside the law to protect his wife and daughter in Martin Scorsese's remake of the classic 1962 thriller.", Year = 1991, IsForeign = false, Length = "128min", Rating = "3.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV" },
                new Movie {Id = 85, DirectorId = 60, GenreId = 3, Title = "Prisoners", Description = "Keller Dover (Hugh Jackman) faces a parent's worst nightmare when his 6-year-old daughter, Anna, and her friend go missing. The only lead is an old motorhome that had been parked on their street. The head of the investigation, Detective Loki (Jake Gyllenhaal), arrests the driver (Paul Dano), but a lack of evidence forces Loki to release his only suspect. Dover, knowing that his daughter's life is at stake, decides that he has no choice but to take matters into his own hands.", Year = 2013, IsForeign = false, Length = "133min", Rating = "4.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV," },
                new Movie {Id = 86, DirectorId = 61, GenreId = 3, Title = "The Usual Suspects", Description = "\"The greatest trick the devil ever pulled was convincing the world he didn't exist,\" says con man Kint (Kevin Spacey), drawing a comparison to the most enigmatic criminal of all time, Keyser Soze. Kint attempts to convince the feds that the mythic crime lord not only exists, but is also responsible for drawing Kint and his four partners into a multi-million dollar heist that ended with an explosion in San Pedro Harbor - leaving few survivors.", Year = 1995, IsForeign = false, Length = "106min", Rating = "4.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Tubi, Pluto" },
                new Movie {Id = 87, DirectorId = 62, GenreId = 3, Title = "Basic Instinct", Description = "The mysterious Catherine Tramell (Sharon Stone), a beautiful crime novelist, becomes a suspect when she is linked to the brutal death of a rock star. Investigated by homicide detective Nick Curran (Michael Douglas), Catherine seduces him into an intense relationship. Meanwhile, the murder case becomes increasingly complicated when more seemingly connected deaths occur and Nick's psychologist and lover, Beth Garner (Jeanne Tripplehorn), appears to be another suspect.", Year = 1992, IsForeign = false, Length = "128min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Max, Hulu, Showtime, FuboTV, Redbox, Sling TV" },
                new Movie {Id = 88, DirectorId = 63, GenreId = 3, Title = "Mystic River", Description = "When the daughter (Emmy Rossum) of ex-con Jimmy Marcus (Sean Penn) is murdered, two of his childhood friends from the neighborhood are involved. Dave (Tim Robbins), a blue-collar worker, was the last person to see her alive, while Sean (Kevin Bacon), a homicide detective, is heading up the case. As Sean proceeds with his investigation, Jimmy conducts one of his own through neighborhood contacts. Eventually, Jimmy suspects Dave is the culprit and considers taking the law into his own hands.", Year = 2003, IsForeign = false, Length = "127min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 89, DirectorId = 47, GenreId = 3, Title = "The Game", Description = "Nicholas Van Orton (Michael Douglas) is a successful banker who keeps mostly to himself. When his estranged brother Conrad (Sean Penn) returns on his birthday with an odd gift -- participation in a personalized, real-life game -- Nicholas reluctantly accepts. Initially harmless, the game grows increasingly personal, and Orton begins to fear for his life as he eludes agents from the mysterious game's organizers. With no one left to trust and his money gone, Orton must find answers for himself.", Year = 1997, IsForeign = false, Length = "109min", Rating = "3.5/5", Rated = "R", ImgUrl = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTpXForETRTNt2fH-8hsTDk9qaAQZXP4U_ivg&usqp=CAU", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 90, DirectorId = 64, GenreId = 3, Title = "Sherlock Holmes: A Game of Shadows", Description = "When Austria's crown prince is found dead, evidence seems to point to suicide. However, detective Sherlock Holmes (Robert Downey Jr.) deduces that the prince was murdered and that the crime is but a piece of a puzzle designed by an evil genius named Moriarty (Jared Harris). Holmes and his friend Dr. Watson (Jude Law), who are accompanied by a Gypsy (Noomi Rapace) whose life Holmes saved, chase Moriarty across Europe in the hope that they can thwart his plot before it can come to fruition.", Year = 2013, IsForeign = false, Length = "109min", Rating = "3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 91, DirectorId = 65, GenreId = 3, Title = "Clue", Description = "Six blackmail victims are invited to an isolated mansion by a man who knows a dark secret from each of their pasts. On arrival, each is given a pseudonym drawn from Cluedo before being introduced to the blackmailer. Each is handed a weapon, at which point the lights are switched off and the blackmailer is killed. Can the guests uncover the murderer before they all become victims?", Year = 1985, IsForeign = false, Length = "97min", Rating = "3.5/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Vudu, Google Play Movies & TV, Roku Chanel, Philo" },
                new Movie {Id = 92, DirectorId = 66, GenreId = 3, Title = "The Girl on the Train", Description = "Commuter Rachel Watson (Emily Blunt) catches daily glimpses of a seemingly perfect couple, Scott and Megan, from the window of her train. One day, Watson witnesses something shocking unfold in the backyard of the strangers' home. Rachel tells the authorities what she thinks she saw after learning that Megan is now missing and feared dead. Unable to trust her own memory, the troubled woman begins her own investigation, while police suspect that Rachel may have crossed a dangerous line.", Year = 2016, IsForeign = false, Length = "112min", Rating = "2.2/5", Rated = "R", ImgUrl = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQJPpgCaOsLmMMrJSzlgo45r4OHJgxDGS9Fww&usqp=CAU", SteamingOn = "TBS, TNT, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 93, DirectorId = 1, GenreId = 1, Title = "The Woman in the Window", Description = "Agoraphobic Dr. Anna Fox witnesses something she shouldn't while keeping tabs on the Russell family, the seemingly picture perfect clan that lives across the way.", Year = 2021, IsForeign = false, Length = "100min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix" },
                new Movie {Id = 94, DirectorId = 68, GenreId = 3, Title = "The Invisible Guest", Description = "A young businessman wakes up in a locked hotel room next to the body of his dead lover. He hires a prestigious lawyer to defend him, and over the course of one night, they work together to find out what happened.", Year = 2016, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "NC-17", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, FlixLatino, Google Play Movies & TV, YouTube," },
                new Movie {Id = 95, DirectorId = 69, GenreId = 3, Title = "Tinker Tailor Soldier Spy", Description = "In 1970s England the head of MI6, Control (John Hurt), dispatches an agent (Mark Strong) to meet with a Hungarian general who knows the identity of a Soviet spy in the organization's ranks. However, the mission goes wrong, and the general dies before he can reveal the information. Undersecretary Oliver Lacon (Simon McBurney) calls veteran agent George Smiley (Gary Oldman) back from forced retirement to ferret out the mole and stop the flow of vital British secrets to the Russians.", Year = 2011 , IsForeign = false, Length = "127min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 96, DirectorId = 70, GenreId = 3, Title = "Gosford Park", Description = "Robert Altman, one of America's most distinctive filmmakers, journeys to England for the first time to create a unique film mosaic with an outstanding ensemble cast. Set in the 1930's, \"Gosford Park\" brings a group of pretentious rich and famous together for a weekend of relaxation at a hunting resort. But when a murder occurs, each one of these interesting characters becomes a suspect.", Year = 2001, IsForeign = false, Length = "137min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox," },
                new Movie {Id = 97, DirectorId = 48, GenreId = 3, Title = "Rope", Description = "Just before hosting a dinner party, Philip Morgan (Farley Granger) and Brandon Shaw (John Dall) strangle a mutual friend to death with a piece of rope, purely as a Nietzsche-inspired philosophical exercise. Hiding the body in a chest upon which they then arrange a buffet dinner, the pair welcome their guests, including the victim's oblivious fiancée (Joan Chandler) and the college professor (James Stewart) whose lectures inadvertently inspired the killing.", Year = 1948, IsForeign = false, Length = "103min", Rating = "4.1/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox," },
                new Movie {Id = 98, DirectorId = 71, GenreId = 11, Title = "Primal Fear", Description = "Defense attorney Martin Vail takes on jobs for money and prestige rather than any sense of the greater good. His latest case involves an altar boy, accused of brutally murdering the archbishop of Chicago. Vail finds himself up against his ex-pupil and ex-lover, but as the case progresses and the Church's dark secrets are revealed, Vail finds that what appeared a simple case takes on a darker, more dangerous aspect.", Year = 2010, IsForeign = false, Length = "130min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Pluto" },
                new Movie {Id = 99, DirectorId = 72, GenreId = 3, Title = "Murder on the Orient Express", Description = "Having concluded a case, detective Hercule Poirot (Albert Finney) settles into what he expects will be a relaxing journey home aboard the Orient Express. But when an unpopular billionaire is murdered en route, Poirot takes up the case, and everyone on board the famous train is a suspect. Using an avalanche blocking the tracks to his advantage, Poirot gradually realizes that many of the passengers have revenge as a motive, and he begins to home in on the culprit.", Year = 1974, IsForeign = false, Length = "131min", Rating = "5/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, FuboTV, ABC" },
                new Movie {Id = 100, DirectorId = 1, GenreId = 3, Title = "Murder on the Orient Express", Description = "A lavish trip through Europe quickly unfolds into a race against time to solve a murder aboard a train. When an avalanche stops the Orient Express dead in its tracks, the world's greatest detective -- Hercule Poirot -- arrives to interrogate all passengers and search for clues before the killer can strike again.", Year = 2017, IsForeign = false, Length = "103min", Rating = "3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Hulu," },
                new Movie {Id = 101, DirectorId = 73, GenreId = 3, Title = "Knives Out", Description = "The circumstances surrounding the death of crime novelist Harlan Thrombey are mysterious, but there's one thing that renowned Detective Benoit Blanc knows for sure -- everyone in the wildly dysfunctional Thrombey family is a suspect. Now, Blanc must sift through a web of lies and red herrings to uncover the truth.", Year = 2019, IsForeign = false, Length = "130min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 102, DirectorId = 73, GenreId = 3, Title = "Glass Onion: A Knives Out Mystery", Description = "Tech billionaire Miles Bron invites his friends for a getaway on his private Greek island. When someone turns up dead, Detective Benoit Blanc is put on the case", Year = 1978, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix" },
                new Movie {Id = 103, DirectorId = 74, GenreId = 3, Title = "8mm", Description = "Private detective Tom Welles (Nicolas Cage) lives a normal life with his wife (Catherine Keener) and young daughter, until he receives a startling new case. A widow named Mrs. Christian (Myra Carter) has found what appears to be a snuff film among her late husband's belongings, and she wants Welles to determine if the movie is real or fake. Welles heads to California, where a video store employee (Joaquin Phoenix) helps him infiltrate the dangerous and depraved world of illegal porn movies.", Year = 1999, IsForeign = false, Length = "123min", Rating = "3.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 104, DirectorId = 75, GenreId = 3, Title = "Bad Times at the El Royale", Description = "The El Royale is run-down hotel that sits on the border between California and Nevada. It soon becomes a seedy battleground when seven strangers -- a cleric, a soul singer, a traveling salesman, two sisters, the manager and the mysterious Billy Lee -- converge on a fateful night for one last shot at redemption before everything goes wrong.", Year = 2018, IsForeign = false, Length = "142min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 105, DirectorId = 76, GenreId = 3, Title = "Murder by Death", Description = "Five diverse, infamous private eyes, including Sam Diamond (Peter Falk), Sidney Wang (Peter Sellers) and Jessica Marbles (Elsa Lanchester), are invited to the mysterious Lionel Twain's castle for a dinner party. There, they are told that Twain plans an unsolvable murder in the house at midnight -- and he will pay $1 million to the one who determines the killer. But when Twain's blind butler, Bensonmum (Alec Guinness), dies long before the deadline, the stakes go up for the trapped sleuths.", Year = 1976, IsForeign = false, Length = "103min", Rating = "3/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 106, DirectorId = 77, GenreId = 8, Title = "Minority Report", Description = "Based on a story by famed science fiction writer Philip K. Dick, \"Minority Report\" is an action-detective thriller set in Washington D.C. in 2054, where police utilize a psychic technology to arrest and convict murderers before they commit their crime. Tom Cruise plays the head of this Precrime unit and is himself accused of the future murder of a man he hasn't even met.", Year = 1978, IsForeign = false, Length = "145min", Rating = "4.8/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 107, DirectorId = 1, GenreId = 3, Title = "Side Effects", Description = "For four years, Emily Taylor (Rooney Mara) has awaited the release of her husband, Martin (Channing Tatum), from being imprisoned for insider trading. Finally, Martin comes home, but Emily feels just as bad as she did when he was incarcerated, and she sinks into a deep depression. After her failed suicide attempt, psychiatrist Jonathan Banks (Jude Law) prescribes a series of medications. When those don't work, he gives Emily a new medication -- but the drug leads to ruined lives and death.", Year = 2013, IsForeign = false, Length = "106min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime, FuboTV, Sling TV" },
                new Movie {Id = 108, DirectorId = 71, GenreId = 3, Title = "Fracture", Description = "Willy Beachum (Ryan Gosling), a hotshot prosecutor, is about to leave his post for a lucrative job at a private law firm when his boss (David Strathairn) hands him a seemingly open-and-shut case. Ted Crawford (Anthony Hopkins) tried to kill his wife with a shot to the head and is defending himself in court. All hope for a quick and easy trial fly out the door when Ted proves to be a more cunning and devious adversary than Willy anticipates.", Year = 2007, IsForeign = false, Length = "103min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 109, DirectorId = 1, GenreId = 1, Title = "Friday", Description = "yadadad", Year = 1978, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 110, DirectorId = 79, GenreId = 3, Title = "High Crimes", Description = "A happily married, successful lawyer (Ashley Judd) is shocked to learn that her husband (Jim Caviezel) has a hidden past as a classified military operative, and is accused of committing a heinous war crime. As she prepares to defend her husband in a top-secret military court, where none of the rules she knows so well apply, she gets help from a wild card (Morgan Freeman) -- a former military attorney who doesn't play by anyone's rules.", Year = 2002, IsForeign = false, Length = "115min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 111, DirectorId = 1, GenreId = 3, Title = "Along Came a Spider ", Description = "A psychological suspense thriller adapted from James Patterson's first highly acclaimed novel in the Alex Cross series, Morgan Freeman reprises his role as the Washington, D.C. police detective and psychologist who is through playing mind games with criminals -- that is until a methodical predator, Gary Soneji (Michael Wincott) commits a daring kidnapping and lures Cross into the case.", Year = 2001, IsForeign = false, Length = "104min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 112, DirectorId = 1, GenreId = 3, Title = "Kiss the Girls", Description = "Successful forensic psychologist Alex Cross (Morgan Freeman) discovers that his niece has gone missing. Once he consults with police Detective Nick Ruskin (Cary Elwes), Cross believes that the disappearance is the work of an insane killer known as \"Casanova.\" Meanwhile, Dr. Kate McTiernan (Ashley Judd) is kidnapped by this criminal and witnesses many other imprisoned women in his lair. After narrowly escaping, McTiernan teams up with Cross to try to apprehend the deranged Casanova.", Year = 1978, IsForeign = false, Length = "115min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 113, DirectorId = 82, GenreId = 3, Title = "Under Suspicion", Description = "\"Under Suspicion\" is an intense, psychological thriller, with veteran Police Captain Victor Benezet squaring off against prominent tax attorney Henry Hearst -- two life-hardened and well-matched opponents motivated by reasons more complex and personal than the pursuit of duty or the defense of reputation. Exploring the darkest recesses of the human imagination, bringing to light the dangerous psychological ramifications of a guilty conscience.", Year = 2000, IsForeign = false, Length = "111min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 114, DirectorId = 83, GenreId = 3, Title = "Now You See Me", Description = "Charismatic magician Atlas (Jesse Eisenberg) leads a team of talented illusionists called the Four Horsemen. Atlas and his comrades mesmerize audiences with a pair of amazing magic shows that drain the bank accounts of the corrupt and funnel the money to audience members. A federal agent (Mark Ruffalo) and an Interpol detective (Mélanie Laurent) intend to rein in the Horsemen before their next caper, and they turn to Thaddeus (Morgan Freeman), a famous debunker, for help.", Year = 2013, IsForeign = false, Length = "103min", Rating = "3.8/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 115, DirectorId = 84, GenreId = 1, Title = "Now You See Me 2", Description = "After fleeing from a stage show, the illusionists (Jesse Eisenberg, Woody Harrelson) known as the Four Horsemen find themselves in more trouble in Macau, China. Devious tech wizard Walter Mabry (Daniel Radcliffe) forces the infamous magicians to steal a powerful chip that can control all of the world's computers. Meanwhile, vengeful FBI agent Dylan Rhodes (Mark Ruffalo) hatches his own plot against Thaddeus Bradley (Morgan Freeman), the man he blames for the death of his father.", Year = 2016, IsForeign = false, Length = "139min", Rating = "3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Tubi" },
                new Movie {Id = 116, DirectorId = 85, GenreId = 3, Title = "Gone Baby Gone", Description = "In a tough Boston suburb, private detective Patrick Kenzie is hired to trace the missing daughter of Helene McCready. Police chief Doyle doesn't think Patrick has a chance as she's been missing for 76 hours already. Patrick recognises the threat from molester Corwin Earle and Haitian gangster Cheese, but in a neighbourhood where he's lived all his life, the real danger may be closer to home.", Year = 2007, IsForeign = false, Length = "114min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime" },
                new Movie {Id = 117, DirectorId = 1, GenreId = 3, Title = "The Negotiator", Description = "Danny Roman (Samuel L. Jackson) is considered the best police hostage negotiator in Chicago. After a friend warns him that someone is embezzling from a disability fund, the person is found dead. Internal affairs investigator Niebaum (J.T. Walsh) discovers the gun used had been handled by Roman. When no one believes his innocence, Roman takes Niebaum hostage. When Chris Sabian (Kevin Spacey) arrives to hear Roman's demands, the two skilled negotiators begin a tense stand-off.", Year = 1998, IsForeign = false, Length = "130min", Rating = "5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Plex, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 118, DirectorId = 86, GenreId = 3, Title = "Hostage", Description = "After one of his hostage negotiations goes awry, LAPD officer Jeff Talley (Bruce Willis) quits the force and relocates his family to the suburbs. As the sheriff in a sleepy town, Jeff thinks he has escaped the hustle and bustle -- until an elaborate local heist puts him back in the center of a hostage situation. When his own family is pulled into the fray, Jeff is forced to decide whether he should try to help the hostages or follow the criminals' hands-off mandate to protect his own family.", Year = 2005, IsForeign = false, Length = "113min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Pluto, Philo, Sling TV" },
                new Movie {Id = 119, DirectorId = 1, GenreId = 1, Title = "Friday", Description = "An airplane bearing gruff U.S. Marshal Sam Gerard (Tommy Lee Jones) crashes in the wilderness. On board the same flight is Mark Sheridan (Wesley Snipes), a federal prisoner accused of double murder, who escapes during the ensuing chaos, but not before rescuing several people from the wreckage. Gerard is ordered to hunt down the fugitive along with State Department agent John Royce (Robert Downey Jr.), and the two pursue Sheridan relentlessly, despite growing doubts about his guilt.", Year = 1998, IsForeign = false, Length = "131min", Rating = "4.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Pluto, Philo, Sling TV" },
                new Movie {Id = 120, DirectorId = 73, GenreId = 3, Title = "Out of Time", Description = "Matt Lee Whitlock (Denzel Washington) is the police chief of a small Florida town, going through a divorce with his detective wife, Alex (Eva Mendes). He begins a passionate affair with Ann (Sanaa Lathan), only to find out that she's stricken with terminal cancer. Matt steals a large sum of money confiscated from a drug bust in order to pay for Ann's treatment -- but when she apparently dies in a suspicious fire, the money disappears, and all the clues point to Matt as the culprit.", Year = 2003, IsForeign = false, Length = "105min", Rating = "4.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = " Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu" },
                new Movie {Id = 121, DirectorId = 87, GenreId = 3, Title = "The Glass House", Description = "After the parents of Ruby (Leelee Sobieski) and her younger brother, Rhett (Trevor Morgan), are killed in a car crash, their parents' best friends, Erin and Terry Glass (Diane Lane, Stellan Skarsgard), become their guardians. The children hear promises of a world of opulence and California fun -- all they have to do is move into the Glasses' gated house. Before very long, though, Ruby suspects that Erin and Terry may not be the ideal guardians they seemed to be.", Year = 2001, IsForeign = false, Length = "111min", Rating = "3.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64, ", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 122, DirectorId = 88, GenreId = 4, Title = "Point Break", Description = "After a string of bizarre bank robberies in Southern California, with the crooks donning masks of various former presidents, a federal agent, Johnny Utah (Keanu Reeves), infiltrates the suspected gang. But this is no ordinary group of robbers. They're surfers -- led by the charismatic Bodhi (Patrick Swayze) -- who are addicted to the rush of thievery. But when Utah falls in love with a female surfer, Tyler (Lori Petty), who is close to the gang, it complicates his sense of duty.", Year = 1978, IsForeign = false, Length = "122min", Rating = "3.8/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Roku Channel, Tubi, Peacock" },
                new Movie {Id = 123, DirectorId = 89, GenreId = 4, Title = "The Rock", Description = "yadadad", Year = 1996, IsForeign = false, Length = "136min", Rating = "3.8/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 124, DirectorId = 90, GenreId = 4, Title = "Heat", Description = "Master criminal Neil McCauley (Robert De Niro) is trying to control the rogue actions of one of his men, while also planning one last big heist before retiring. Meanwhile, Lieutenant Hanna (Al Pacino) attempts to track down McCauley as he deals with the chaos in his own life, including the infidelity of his wife (Diane Venora) and the mental health of his stepdaughter (Natalie Portman). McCauley and Hanna discover a mutual respect, even as they try to thwart each other's plans.", Year = 1995, IsForeign = false, Length = "103min", Rating = "4.6/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 125, DirectorId = 91, GenreId = 4, Title = "Speed", Description = "Los Angeles police officer Jack (Keanu Reeves) angers retired bomb squad member Howard Payne (Dennis Hopper) by foiling his attempt at taking hostages. In revenge, Payne arms a bus with a bomb that will explode if it drops below 50 miles per hour. With the help of spunky passenger Annie (Sandra Bullock), Jack and his partner Harry (Jeff Daniels) try to save the people on the bus before the bomb goes off, while also trying to figure out how Payne is monitoring them.", Year = 1994, IsForeign = false, Length = "103min", Rating = "4.6/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Starz, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu" },
                new Movie {Id = 126, DirectorId = 91, GenreId = 4, Title = "Speed 2: Cruise Control", Description = "Annie (Sandra Bullock) is looking forward to a Caribbean cruise with her cop boyfriend, Alex (Jason Patric), who purchased the tickets to make up for lying about working on the SWAT team. Their trip turns dangerous, however, when an explosion disables the ship's communication system and it becomes clear that the vessel is under someone else's control. Alex and Annie must fight for survival as they discover that John Geiger (Willem Dafoe), a crazed passenger, is behind the chaos.", Year = 1997, IsForeign = false, Length = "126min", Rating = "2.9/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Starz, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu" },
                new Movie {Id = 127, DirectorId = 92, GenreId = 4, Title = "Air Force One", Description = "yadadad", Year = 1997, IsForeign = false, Length = "125min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, AMC" },
                new Movie {Id = 128, DirectorId = 93, GenreId = 4, Title = "Mission: Impossible", Description = "When U.S. government operative Ethan Hunt (Tom Cruise) and his mentor, Jim Phelps (Jon Voight), go on a covert assignment that takes a disastrous turn, Jim is killed, and Ethan becomes the prime murder suspect. Now a fugitive, Hunt recruits brilliant hacker Luther Stickell (Ving Rhames) and maverick pilot Franz Krieger (Jean Reno) to help him sneak into a heavily guarded CIA building to retrieve a confidential computer file that will prove his innocence.", Year = 1996, IsForeign = false, Length = "110min", Rating = "4.2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 129, DirectorId = 52, GenreId = 4, Title = "Mission: Impossible II", Description = "Tom Cruise returns to his role as Ethan Hunt in the second installment of \"Mission: Impossible.\" This time Ethan Hunt leads his IMF team on a mission to capture a deadly German virus before it is released by terrorists. His mission is made impossible due to the fact that he is not the only person after samples of the disease. He must also contest with a gang of international terrorists headed by a turned bad former IMF agent who has already managed to steal the cure.", Year = 2000, IsForeign = false, Length = "123min", Rating = "3.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 130, DirectorId = 53, GenreId = 4, Title = "Mission: Impossible III", Description = "Retired from active duty, and training recruits for the Impossible Mission Force, agent Ethan Hunt (Tom Cruise) faces the toughest foe of his career: Owen Davian (Philip Seymour Hoffman), an international broker of arms and information, who is as cunning as he is ruthless. Davian emerges to threaten Hunt and all that he holds dear -- including the woman Hunt loves.", Year = 2006, IsForeign = false, Length = "126min", Rating = "4.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 131, DirectorId = 54, GenreId = 4, Title = "Mission: Impossible - Ghost Protocol", Description = "Blamed for a terrorist attack on the Kremlin, Ethan Hunt (Tom Cruise) and the entire IMF agency are disavowed by the U.S. government, while the president initiates the Ghost Protocol. Forced to go \"off the grid\" -- left without resources or backup -- Hunt must somehow clear the agency's name and prevent another attack. Complicating matters even more, Ethan must undertake the impossible mission with a group of fellow IMF fugitives whose actual motives are suspect.", Year = 1978, IsForeign = false, Length = "133min", Rating = "4.7/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 132, DirectorId = 95, GenreId = 4, Title = "Mission: Impossible - Rogue Nation", Description = "yadadad", Year = 1978, IsForeign = false, Length = "103min", Rating = "4.7/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Hulu" },
                new Movie {Id = 133, DirectorId = 95, GenreId = 4, Title = "Mission: Impossible - Fallout", Description = "Ethan Hunt and the IMF team join forces with CIA assassin August Walker to prevent a disaster of epic proportions. Arms dealer John Lark and a group of terrorists known as the Apostles plan to use three plutonium cores for a simultaneous nuclear attack on the Vatican, Jerusalem and Mecca, Saudi Arabia. When the weapons go missing, Ethan and his crew find themselves in a desperate race against time to prevent them from falling into the wrong hands.", Year = 2018, IsForeign = false, Length = "148min", Rating = "4.7/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Hulu" },
                new Movie {Id = 134, DirectorId = 97, GenreId = 4, Title = "Taken", Description = "Bryan Mills (Liam Neeson), a former government operative, is trying to reconnect with his daughter, Kim (Maggie Grace). Then his worst fears become real when sex slavers abduct Kim and her friend shortly after they arrive in Paris for vacation. With just four days until Kim will be auctioned off, Bryan must call on every skill he learned in black ops to rescue her.", Year = 2008, IsForeign = false, Length = "93min", Rating = "4.7/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Sling TV" },
                new Movie {Id = 135, DirectorId = 98, GenreId = 4, Title = "Taken 2", Description = "Two years ago, retired CIA agent Bryan Mills (Liam Neeson) used his \"particular set of skills\" to rescue his daughter, Kim (Maggie Grace), from kidnappers. Since then, Kim has been learning self-defense from her father, and Bryan has been on a personal mission to reunite with his ex-wife (Famke Janssen). In Istanbul, Bryan and his family cross paths with Murad (Rade Serbedzija), whose son died at Bryan's hand during Kim's rescue. Murad wants revenge, and he'll stop at nothing to get it.", Year = 2012, IsForeign = false, Length = "92min", Rating = "4.1/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Sling TV" },
                new Movie {Id = 136, DirectorId = 98, GenreId = 4, Title = "Friday", Description = "yadadad", Year = 1978, IsForeign = false, Length = "115min", Rating = "4.1/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Sling TV" },
                new Movie {Id = 137, DirectorId = 96, GenreId = 4, Title = "Die Hard", Description = "New York City policeman John McClane (Bruce Willis) is visiting his estranged wife (Bonnie Bedelia) and two daughters on Christmas Eve. He joins her at a holiday party in the headquarters of the Japanese-owned business she works for. But the festivities are interrupted by a group of terrorists who take over the exclusive high-rise, and everyone in it. Very soon McClane realizes that there's no one to save the hostages -- but him.", Year = 1988, IsForeign = false, Length = "132min", Rating = "4.7/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "FX, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Sling TV" },
                new Movie {Id = 138, DirectorId = 99, GenreId = 4, Title = "Die Hard 2", Description = "A year after his heroics in L.A, detective John McClane (Bruce Willis) is mixed up in another terrorist plot, this time at Washington Dulles International Airport, where he is waiting for his wife (Bonnie Bedelia). That same night, South American politico and drug profiteer Ramon Esperanza (Franco Nero) is arriving in U.S. custody. McClane takes action when a treasonous ex-colonel (William Sadler) seizes control of the airport, threatening to crash every inbound flight unless Esperanza is freed.", Year = 1990, IsForeign = false, Length = "134min", Rating = "4.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube,, Hulu" },
                new Movie {Id = 139, DirectorId = 96, GenreId = 4, Title = "Die Hard with a Vengeance", Description = "Detective John McClane (Bruce Willis) is now divorced, alcoholic and jobless after getting fired for his reckless behavior and bad attitude. He is called back into action, however, when a cryptic terrorist (Jeremy Irons) takes New York City hostage in a lethal game of \"Simon Says\" and refuses to speak with anyone but McClane. Teaming up with a street-savvy electrician named Zeus Carver (Samuel L. Jackson), McClane dashes through the city, trying to stay one step ahead of a murderous plot", Year = 1995, IsForeign = false, Length = "138min", Rating = "4.6/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "FX, Hulu, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 140, DirectorId = 100, GenreId = 4, Title = "Live Free or Die Hard", Description = "As the nation prepares to celebrate Independence Day, veteran cop John McClane (Bruce Willis) carries out another routine assignment: bringing in a computer hacker (Justin Long) for questioning. Meanwhile, a tech-savvy villain named Thomas Gabriel (Timothy Olyphant) launches an attack on America's computer infrastructure. As chaos descends around him, McClane must use old-fashioned methods to fight the high-tech threat.", Year = 2007, IsForeign = false, Length = "138min", Rating = "4.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Max," },
                new Movie {Id = 141, DirectorId = 1, GenreId = 4, Title = "A Good Day to Die Hard", Description = "yadadad", Year = 2013, IsForeign = false, Length = "98min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "FX, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu," },
                new Movie {Id = 142, DirectorId = 101, GenreId = 4, Title = "Red", Description = "After surviving an assault from a squad of hit men, retired CIA agent Frank Moses (Bruce Willis) reassembles his old team for an all-out war. Frank reunites with old Joe (Morgan Freeman), crazy Marvin (John Malkovich) and wily Victoria (Helen Mirren) to uncover a massive conspiracy that threatens their lives. Only their expert training will allow them to survive a near-impossible mission -- breaking into CIA headquarters.", Year = 2010, IsForeign = false, Length = "111min", Rating = "4.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 143, DirectorId = 102, GenreId = 4, Title = "Red 2", Description = "Former CIA black-ops agent Frank Moses (Bruce Willis) and his old partner, Marvin Boggs (John Malkovich), are caught in the grip of retirement -- but that soon changes when a powerful Cold War weapon known as Nightshade resurfaces decades after its disappearance. With assassins hot on their trail, Frank and his team set out to find the one scientist (Anthony Hopkins) who can unravel the mystery of Nightshade and help them save themselves -- and the world", Year = 2013, IsForeign = false, Length = "116min", Rating = "4.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 144, DirectorId = 103, GenreId = 4, Title = "The A-Team", Description = "A man who loves when a plan comes together, Hannibal Smith (Liam Neeson) leads a close-knit team of elite operatives. Framed for a terrible crime, Smith and his men go rogue, using their special talents to clear their names and find the perpetrator. Hot on their trail is Charissa Sosa (Jessica Biel), who was once involved with a member of Smith's team and has sworn to capture them, no matter what it takes.", Year = 2010, IsForeign = false, Length = "117min", Rating = "4.4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "FX, Hulu, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                new Movie {Id = 145, DirectorId = 104, GenreId = 4, Title = "Olympus Has Fallen", Description = "The unthinkable happens when heavily armed and highly trained terrorists launch a bold daytime attack on the White House. The building is overrun, and President Benjamin Asher (Aaron Eckhart) and his staff are taken hostage. Luckily for Asher, former presidential security officer Mike Banning (Gerard Butler) is on the scene. With time running out, it's up to Banning to locate Asher's son before the extremists do and rescue the president before his captors unleash their ultimate plan.", Year = 2013, IsForeign = false, Length = "120min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Sling TV, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube," },
                 new Movie {Id = 146, DirectorId = 105, GenreId = 4, Title = "London Has Fallen", Description = "After the death of the British prime minister, the world's most powerful leaders gather in London to pay their respects. Without warning, terrorists unleash a devastating attack that leaves the city in chaos and ruins. Secret Service agent Mike Banning (Gerard Butler) springs into action to bring U.S. President Benjamin Asher (Aaron Eckhart) to safety. When Asher falls into the hands of the sinister organization, it's up to Banning to save his commander in chief from a horrible fate.", Year = 2016, IsForeign = false, Length = "99min", Rating = "3.7/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox," },
                new Movie {Id = 147, DirectorId = 89, GenreId = 4, Title = "Bad Boys", Description = "Miami-Dade detectives Mike Lowrey (Will Smith) and Marcus Burnett (Martin Lawrence) blow a fuse when $100 million worth of heroin they recently confiscated is heisted from station headquarters. Suspecting it was an inside job, Internal Affairs gives them five days to track down the drugs before they shut down the narcotics division. Action meets farce when Marcus is compelled to masquerade as his partner in order to gain the trust of a call girl (Tea Leoni), a key witness in their investigation.", Year = 1995, IsForeign = false, Length = "119min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 148, DirectorId = 89, GenreId = 4, Title = "Bad Boys II", Description = "yadadad", Year = 1978, IsForeign = false, Length = "103min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 149, DirectorId = 1, GenreId = 4, Title = "Bad Boys For Life", Description = "The wife and son of a Mexican drug lord embark on a vengeful quest to kill all those involved in his trial and imprisonment -- including Miami Detective Mike Lowrey. When Mike gets wounded, he teams up with partner Marcus Burnett and AMMO -- a special tactical squad -- to bring the culprits to justice. But the old-school, wisecracking cops must soon learn to get along with their new elite counterparts if they are to take down the vicious cartel that threatens their lives", Year = 2020, IsForeign = false, Length = "103min", Rating = "4.2/5", Rated = 
