                new Movie {Id = 150, DirectorId = 107, GenreId = 4, Title = "Lethal Weapon", Description = "Following the death of his wife, Los Angeles police detective Martin Riggs (Mel Gibson) becomes reckless and suicidal. When he is reassigned and partnered with Roger Murtaugh (Danny Glover), Riggs immediately clashes with the older officer. Together they uncover a massive drug-trafficking ring. As they encounter increasingly dangerous situations, Riggs and Murtaugh begin to form a bond. Riggs' volatile behavior might just help them apprehend the criminals -- if it doesn't kill them both first.", Year = 1987, IsForeign = false, Length = "117min", Rating = "4.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 151, DirectorId = 107, GenreId = 4, Title = "Lethal Weapon 2", Description = "South African smugglers find themselves being hounded and harassed by Riggs and Murtaugh, two mismatched Los Angeles police officers. However, the South Africans are protected by diplomatic immunity, and so the two are assigned to witness-protection duty in an attempt by their captain to keep his job. It is only when this witness reveals to them that he has already dealt with the smugglers that the trouble really starts.", Year = 1989, IsForeign = false, Length = "118min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
