                new Movie {Id = 154, DirectorId = 108, GenreId = 4, Title = "The Fast and the Furious", Description = "yadadad", Year = 2001, IsForeign = false, Length = "106min", Rating = "4.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 155, DirectorId = 109, GenreId = 4, Title = "2 Fast 2 Furious", Description = "This sequel focuses on ex-police officer Brian O'Conner (Paul Walker), who relocates from Los Angeles to Miami to start over. Becoming involved in the street-racing scene in his new city, Brian befriends car-savvy Tej (Chris \"Ludacris\" Bridges) and Suki (Devon Aoki), but his competitive streak ends when federal agents apprehend him and he must enter into a deal with the FBI. Working with new partner Roman Pearce (Tyrese), Brian begins a dangerous mission to take down a powerful drug dealer.", Year = 1978, IsForeign = false, Length = "107min", Rating = "4.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 156, DirectorId = 110, GenreId = 4, Title = "The Fast and the Furious: Tokyo Drift", Description = "Sean Boswell (Lucas Black) always feels like an outsider, but he defines himself through his victories as a street racer. His hobby makes him unpopular with the authorities, so he goes to live with his father in Japan. Once there and even more alienated, he learns about an exciting, but dangerous, new style of the sport. The stakes are high when Sean takes on the local champion and falls for the man's girlfriend.", Year = 2006, IsForeign = false, Length = "104min", Rating = "4.6/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 157, DirectorId = 110, GenreId = 4, Title = "Fast & Furious", Description = "yadadad", Year = 2009, IsForeign = false, Length = "107min", Rating = "4.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 158, DirectorId = 110, GenreId = 4, Title = "FAST Five", Description = "Ever since ex-cop Brian O'Conner (Paul Walker) and Mia Torretto (Jordana Brewster) broke her brother Dom (Vin Diesel) out of custody, they've traveled border to border to evade authorities. In Rio de Janeiro, they must do one final job before they can gain their freedom for good. Assembling their elite team of car racers, Brian and Dom know they must confront the corrupt businessman who wants them dead, before the federal agent (Dwayne Johnson) on their trail finds them.", Year = 2011, IsForeign = false, Length = "130min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 159, DirectorId = 110, GenreId = 4, Title = "Fast & Furious 6", Description = "Since Dom (Vin Diesel) and Brian's (Paul Walker) heist in Rio left them and their crew very rich people, they've scattered across the globe; however, they must still live as fugitives, unable to return home to their families. Meanwhile, Agent Hobbs (Dwayne Johnson) has been tracking a gang of lethally skilled mercenary drivers whose second-in-command is someone Dom knows. Unable to take them down himself, Hobbs asks Dom and his crew for help in exchange for full pardons for everyone.", Year = 2013, IsForeign = false, Length = "130min", Rating = "4.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 160, DirectorId = 111, GenreId = 4, Title = "Furious 7", Description = "After defeating international terrorist Owen Shaw, Dominic Toretto (Vin Diesel), Brian O'Conner (Paul Walker) and the rest of the crew have separated to return to more normal lives. However, Deckard Shaw (Jason Statham), Owen's older brother, is thirsty for revenge. A slick government agent offers to help Dom and company take care of Shaw in exchange for their help in rescuing a kidnapped computer hacker who has developed a powerful surveillance program.", Year = 1978, IsForeign = false, Length = "137min", Rating = "4.8/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 161, DirectorId = 1, GenreId = 4, Title = "The Fate of the Furious", Description = "With Dom and Letty married, Brian and Mia retired and the rest of the crew exonerated, the globe-trotting team has found some semblance of a normal life. They soon face an unexpected challenge when a mysterious woman named Cipher forces Dom to betray them all. Now, they must unite to bring home the man who made them a family and stop Cipher from unleashing chaos.", Year = 2017, IsForeign = false, Length = "136min", Rating = "4.4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 162, DirectorId = 110, GenreId = 4, Title = "F9", Description = "Dom Toretto is living the quiet life off the grid with Letty and his son, but they know that danger always lurks just over the peaceful horizon. This time, that threat forces Dom to confront the sins of his past to save those he loves most. His crew soon comes together to stop a world-shattering plot by the most skilled assassin and high-performance driver they've ever encountered -- Dom's forsaken brother.", Year = 1978, IsForeign = false, Length = "143min", Rating = "3.1/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 163, DirectorId = 110, GenreId = 4, Title = "Fast X", Description = "Over many missions and against impossible odds, Dom Toretto and his family have outsmarted and outdriven every foe in their path. Now, they must confront the most lethal opponent they've ever faced. Fueled by revenge, a terrifying threat emerges from the shadows of the past to shatter Dom's world and destroy everything -- and everyone -- he loves", Year = 2023, IsForeign = false, Length = "141min", Rating = "3.2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, Netflix, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 164, DirectorId = 112, GenreId = 4, Title = "Hobbs & Shaw", Description = "Brixton Lorr is a cybernetically enhanced soldier who possesses superhuman strength, a brilliant mind and a lethal pathogen that could wipe out half of the world's population. It's now up to hulking lawman Luke Hobbs and lawless operative Deckard Shaw to put aside their past differences and work together to prevent the seemingly indestructible Lorr from destroying humanity", Year = 2019, IsForeign = false, Length = "136min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 165, DirectorId = 104, GenreId = 4, Title = "The Equalizer 3", Description = "Since giving up his life as a government assassin, Robert McCall finds solace in serving justice on behalf of the oppressed. Now living in Southern Italy, he soon discovers his new friends are under the control of local crime bosses. As events turn deadly, McCall becomes their protector by taking on the mafia.", Year = 2023, IsForeign = false, Length = "109min", Rating = "3.8/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 166, DirectorId = 104, GenreId = 4, Title = "The Equalizer", Description = "Robert McCall (Denzel Washington), a man of mysterious origin who believes he has put the past behind him, dedicates himself to creating a quiet new life. However, when he meets Teri (Chloë Grace Moretz), a teenager who has been manhandled by violent Russian mobsters, he simply cannot walk away. With his set of formidable skills, McCall comes out of self-imposed retirement and emerges as an avenging angel, ready to take down anyone who brutalizes the helpless.", Year = 2014, IsForeign = false, Length = "132min", Rating = "4.6/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "STARZ, Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 167, DirectorId = 104, GenreId = 4, Title = "The Equalizer 2", Description = "If you have a problem and there is nowhere else to turn, the mysterious and elusive Robert McCall will deliver the vigilante justice you seek. This time, however, McCall's past cuts especially close to home when thugs kill Susan Plummer -- his best friend and former colleague. Now out for revenge, McCall must take on a crew of highly trained assassins who'll stop at nothing to destroy him.", Year = 2018, IsForeign = false, Length = "103min", Rating = "4.4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "STARZ, Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 168, DirectorId = 104, GenreId = 4, Title = "Training Day", Description = "Police drama about a veteran officer who escorts a rookie on his first day with the LAPD's tough inner-city narcotics unit. \"Training Day\" is a blistering action drama that asks the audience to decide what is necessary, what is heroic and what crosses the line in the harrowing gray zone of fighting urban crime. Does law-abiding law enforcement come at the expense of justice and public safety? If so, do we demand safe streets at any cost?", Year = 2001, IsForeign = false, Length = "122min", Rating = "4.6/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "VIX, Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 169, DirectorId = 113, GenreId = 4, Title = "The Bourne Identity", Description = "The story of a man (Matt Damon), salvaged, near death, from the ocean by an Italian fishing boat. When he recuperates, the man suffers from total amnesia, without identity or background... except for a range of extraordinary talents in fighting, linguistic skills and self-defense that speak of a dangerous past. He sets out on a desperate search-assisted by the initially rebellious Marie (Franka Potente) - to discover who he really is, and why he's being lethally pursued by assassins.", Year = 2002, IsForeign = false, Length = "119min", Rating = "4.6/5", Rated = "119", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 170, DirectorId = 114, GenreId = 4, Title = "The Bourne Supremacy", Description = "Jason Bourne (Matt Damon) is living in India when he is framed by Russian agent Kirill (Karl Urban) for the theft of millions from the CIA. Kirill begins to pursue Bourne, intending to assassinate him -- but while Bourne and his girlfriend, Marie (Franka Potente), are on the run, a shot meant for him kills her instead. Vowing revenge, Bourne sets out to prove his innocence and bring the culprits to justice, but he has to evade CIA head Pamela Landry (Joan Allen), who is convinced he is guilty.", Year = 2004, IsForeign = false, Length = "108min", Rating = "4.6/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 171, DirectorId = 114, GenreId = 4, Title = "The Bourne Ultimatum", Description = "A former CIA assassin continues his quest to fill in memory gaps. When a `Guardian' reporter stumbles onto his trail, the man spies his chance to blow the Blackbriar black-ops brigade wide open. With some very powerful people intent on keeping their skeletons buried, he is in more danger than ever before, as his former paymasters send a series of elite killers after their reformed ex-colleague.", Year = 2007, IsForeign = false, Length = "115min", Rating = "4.6/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu" },
                new Movie {Id = 172, DirectorId = 115, GenreId = 4, Title = "The Bourne Legacy", Description = "yadadad", Year = 1978, IsForeign = false, Length = "135min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 173, DirectorId = 114, GenreId = 4, Title = "Jason Bourne", Description = "It's been 10 years since Jason Bourne (Matt Damon) walked away from the agency that trained him to become a deadly weapon. Hoping to draw him out of the shadows, CIA director Robert Dewey assigns hacker and counterinsurgency expert Heather Lee to find him. Lee suspects that former operative Nicky Parsons is also looking for him. As she begins tracking the duo, Bourne finds himself back in action battling a sinister network that utilizes terror and technology to maintain unchecked power.", Year = 2016, IsForeign = false, Length = "123min", Rating = "4.1/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 174, DirectorId = 116, GenreId = 4, Title = "John Wick", Description = "Legendary assassin John Wick (Keanu Reeves) retired from his violent career after marrying the love of his life. Her sudden death leaves John in deep mourning. When sadistic mobster Iosef Tarasov (Alfie Allen) and his thugs steal John's prized car and kill the puppy that was a last gift from his wife, John unleashes the remorseless killing machine within and seeks vengeance. Meanwhile, Iosef's father (Michael Nyqvist) -- John's former colleague -- puts a huge bounty on John's head.", Year = 2014, IsForeign = false, Length = "101min", Rating = "4.6/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 175, DirectorId = 116, GenreId = 4, Title = "John Wick: Chapter 2", Description = "Retired super-assassin John Wick's plans to resume a quiet civilian life are cut short when Italian gangster Santino D'Antonio shows up on his doorstep with a gold marker, compelling him to repay past favours. Ordered by Winston, the kingpin of secret assassin society The Continental, to respect the organisation's ancient code, Wick reluctantly accepts the assignment to travel to Rome to take out D'Antonio's sister, the ruthless capo atop the Italian Camorra crime syndicate.", Year = 2017, IsForeign = false, Length = "122min", Rating = "4.6/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 176, DirectorId = 116, GenreId = 4, Title = "John Wick: Chapter 3 - Parabellum", Description = "After gunning down a member of the High Table -- the shadowy international assassin's guild -- legendary hit man John Wick finds himself stripped of the organization's protective services. Now stuck with a $14 million bounty on his head, Wick must fight his way through the streets of New York as he becomes the target of the world's most ruthless killers.", Year = 2019, IsForeign = false, Length = "131min", Rating = "4.4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 177, DirectorId = 116, GenreId = 4, Title = "John Wick: Chapter 4", Description = "With the price on his head ever increasing, legendary hit man John Wick takes his fight against the High Table global as he seeks out the most powerful players in the underworld, from New York to Paris to Japan to Berlin", Year = 2023, IsForeign = false, Length = "169min", Rating = "3.9/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 178, DirectorId = 117, GenreId = 4, Title = "First Blood", Description = "Vietnam veteran and drifter John J. Rambo (Sylvester Stallone) wanders into a small Washington town in search of an old friend, but is met with intolerance and brutality by the local sheriff, Will Teasle (Brian Dennehy). When Teasle and his deputies restrain and shave Rambo, he flashes back to his time as a prisoner of war and unleashes his fury on the officers. He narrowly escapes the manhunt, but it will take his former commander (Richard Crenna) to save the hunters from the hunted.", Year = 1982, IsForeign = false, Length = "93min", Rating = "4.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime" },
                new Movie {Id = 179, DirectorId = 118, GenreId = 4, Title = "Rambo: First Blood Part II", Description = "John Rambo (Sylvester Stallone) is doing hard time in jail when his former boss, Col. Troutman (Richard Crenna), offers him a deal. If Rambo travels to Vietnam to try to find the American prisoners of war, his criminal record will be expunged. Rambo takes the reconnaissance assignment and agrees not to get involved in any of the action. However, when his Vietnamese lover, Co Bao (Julia Nickson), is killed by American forces, Rambo forgets his promise and takes matters into his own hands.", Year = 1985, IsForeign = false, Length = "96min", Rating = "4.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime" },
                new Movie {Id = 180, DirectorId = 119, GenreId = 4, Title = "Rambo III", Description = "Col. Sam Trautman (Richard Crenna) travels to Thailand, hoping to convince veteran John Rambo (Sylvester Stallone) to accompany him on a training mission in Afghanistan. When Rambo refuses, Trautman decides to go alone -- but, while trying to help the mujahideen, Trautman is captured by a ruthless Russian colonel (Marc de Jonge) who submits him to torture. Hearing the news, Rambo volunteers for a top secret undercover mission to rescue his longtime friend.", Year = 1988, IsForeign = false, Length = "102min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime" },
                new Movie {Id = 181, DirectorId = 120, GenreId = 4, Title = "Rambo", Description = "Having long-since abandoned his life as a lethal soldier, John Rambo (Sylvester Stallone) lives a solitary life near the Thai border. Two weeks after guiding a missionary (Julie Benz) and her comrades into Burma, he gets an urgent call for help. The missionaries have not returned and although he is reluctant to embrace violence again, Rambo sets out to rescue the captives from the Burmese army.", Year = 2008, IsForeign = false, Length = "93min", Rating = "4.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 182, DirectorId = 121, GenreId = 4, Title = "Rambo: Last Blood", Description = "Vietnam War veteran John Rambo tries to find some semblance of peace by raising horses on a ranch in Arizona. He's also developed a special familial bond with a woman named Maria and her teenage granddaughter Gabriela. But when a vicious Mexican cartel kidnaps Gabriela, Rambo crosses the border on a bloody and personal quest to rescue her and punish those responsible.", Year = 2019, IsForeign = false, Length = "100min", Rating = "4.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 183, DirectorId = 48, GenreId = 5, Title = "The Birds", Description = "Melanie Daniels (Tippi Hedren) meets Mitch Brenner (Rod Taylor) in a San Francisco pet store and decides to follow him home. She brings with her the gift of two love birds and they strike up a romance. One day birds start attacking children at Mitch's sisters party. A huge assault starts on the town by attacking birds.", Year = 1963, IsForeign = false, Length = "119min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Peacock, AMC, Philo, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 184, DirectorId = 122, GenreId = 5, Title = "Child's Play", Description = "Gunned down by Detective Mike Norris (Chris Sarandon), dying murderer Charles Lee Ray (Brad Dourif) uses black magic to put his soul inside a doll named Chucky -- which Karen Barclay (Catherine Hicks) then buys for her young son, Andy (Alex Vincent). When Chucky kills Andy's baby sitter, the boy realizes the doll is alive and tries to warn people, but he's institutionalized. Now Karen must convince the detective of the murderous doll's intentions, before Andy becomes Chucky's next victim.", Year = 1988, IsForeign = false, Length = "87min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Paramount,  Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu" },
                new Movie {Id = 185, DirectorId = 123, GenreId = 5, Title = "Child's Play 2", Description = "Two years after serial killer Charles Lee Ray (Brad Dourif) inserted his soul into a Chucky doll, a toy company attempts to re-create the doll, bringing Ray back in the process. The possessed doll, intent on claiming a human body, kills his way toward former owner Andy (Alex Vincent), who now lives in a foster home. Andy's foster sister, Kyle (Christine Elise), tries to protect him, but his foster parents believe Andy is just a troubled kid -- and Chucky's murderous path continues", Year = 1990, IsForeign = false, Length = "84min", Rating = "4.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "FuboTV, Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 186, DirectorId = 124, GenreId = 5, Title = "Child's Play 3", Description = "It's been years since Chucky, the doll with the soul and the voice (Brad Dourif) of a psychopathic killer, was apparently destroyed in a fire at a doll factory. Now Chucky's manufacturer is remaking the same line of toys with the old, still haunted materials. This resurrects Chucky, who goes after Andy (Justin Whalin), his former owner, who now attends military school. Chucky slashes his way through a string of grotesque murders as Andy tries to stop the homicidal doll and the spirit within it.", Year = 1991, IsForeign = false, Length = "90min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "FuboTV, Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 187, DirectorId = 125, GenreId = 4, Title = "Bride of Chucky", Description = "After being cut apart by the police, killer doll Chucky (Brad Dourif) is resurrected by Tiffany (Jennifer Tilly), an ex-girlfriend of the serial murderer whose soul is inside the toy. Following an argument, Chucky kills Tiffany and transfers her soul into a bride doll. To find the magical amulet that can restore them both to human form, Chucky and Tiffany arrange to be driven to New Jersey by Jesse (Nick Stabile) and Jade (Katherine Heigl), who are unaware that their cargo is alive.", Year = 1998, IsForeign = false, Length = "100min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "FuboTV, Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 188, DirectorId = 126, GenreId = 5, Title = "Seed of Chucky", Description = "Gentle Glen (Billy Boyd) is a ventriloquist's dummy, the offspring of evil doll Chucky (Brad Dourif) and his doll bride (Jennifer Tilly), both of whom are now deceased. When the orphaned Glen hears that a film is being made about his parents, he goes to Hollywood and resurrects them in an attempt to get to know them better. He is horrified when Chucky and his lover embark on a new killing spree, and Chucky is equally horrified that his son has no taste for evil.", Year = 1978, IsForeign = false, Length = "93min", Rating = "3.7/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "FuboTV, Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 189, DirectorId = 126, GenreId = 5, Title = "Curse of Chucky", Description = "Looking for revenge, Chucky the killer doll infiltrates and terrorises the family of a woman, her sister, and her young niece.", Year = 2013, IsForeign = false, Length = "97min", Rating = "3.9/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "" },
                new Movie {Id = 190, DirectorId = 126, GenreId = 5, Title = "Cult of Chucky", Description = "Chucky returns to terrorize his human victim, Nica, who is confined to an asylum for the criminally insane. Meanwhile, the killer doll has some scores to settle with his old enemies, with the help of his former wife", Year = 2017, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "FuboTV, Peacock, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 191, DirectorId = 127, GenreId = 5, Title = "Child's Play", Description = "After moving to a new city, young Andy Barclay receives a special present from his mother -- a seemingly innocent Buddi doll that becomes his best friend. When the doll suddenly takes on a life of its own, Andy unites with other neighborhood children to stop the sinister toy from wreaking bloody havoc.", Year = 2019, IsForeign = false, Length = "90min", Rating = "3.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, AMC" },
                new Movie {Id = 192, DirectorId = 128, GenreId = 5, Title = "Halloween", Description = "On a cold Halloween night in 1963, six year old Michael Myers brutally murdered his 17-year-old sister, Judith. He was sentenced and locked away for 15 years. But on October 30, 1978, while being transferred for a court date, a 21-year-old Michael Myers steals a car and escapes Smith's Grove. He returns to his quiet hometown of Haddonfield, Illinois, where he looks for his next victims.", Year = 1978, IsForeign = false, Length = "103min", Rating = "4.4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime, FuboTV, Sling TV, Crackle, PLEX" },
                new Movie {Id = 193, DirectorId = 129, GenreId = 5, Title = "Halloween II", Description = "After failing to kill stubborn survivor Laurie (Jamie Lee Curtis) and taking a bullet or six from former psychiatrist Dr. Sam Loomis (Donald Pleasence), Michael Myers (Jonathan Prince) has followed Laurie to the Haddonfield Memorial Hospital, where she's been admitted for Myers' attempt on her life. The institution proves to be particularly suited to serial killers, however, as Myers cuts, stabs and slashes his way through hospital staff to reach his favorite victim.", Year = 1981, IsForeign = false, Length = "92min", Rating = "3.8/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Peacock, AMC" },
                new Movie {Id = 194, DirectorId = 130, GenreId = 5, Title = "Halloween III: Season of the Witch", Description = "Hospital emergency room Dr. Daniel \"Dan\" Challis (Tom Atkins) and Ellie Grimbridge (Stacey Nelkin), the daughter of a murder victim, uncover a terrible plot by small-town mask maker Conal Cochran (Dan O'Herlihy), a madman who's planning a Halloween mass murder utilizing an ancient Celtic ritual. The ritual involves a boulder stolen from Stonehenge, the use of Silver Shamrock masks and a triggering device contained in a television commercial -- all designed to kill millions of children.", Year = 1982, IsForeign = false, Length = "99min", Rating = "3.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Peacock, AMC" },
                new Movie {Id = 195, DirectorId = 131, GenreId = 5, Title = "Halloween 4: The Return of Michael Myers", Description = "The apparently comatose Michael Myers (George P. Wilbur) is being transferred from one hospital to another, but he wakes up when the ambulance crew talk about his surviving niece, Jamie (Danielle Harris). After slaughtering his attendants, Myers sets out to find his one living relative who is, fortunately, being cared for by a kind and resourceful foster sister named Rachel (Ellie Cornell). Meanwhile, the ever-cautious Dr. Loomis (Donald Pleasence) remains on the killer's path.", Year = 1978, IsForeign = false, Length = "92min", Rating = "3.9/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Peacock, AMC" },
                new Movie {Id = 196, DirectorId = 132, GenreId = 5, Title = "Halloween 5: The Revenge of Michael Myers", Description = "After lying in a coma for a year, Michael Myers (Donald L. Shanks) awakens and stalks his way back to his small hometown in Illinois, intent on killing his niece, Jamie (Danielle Harris), who has been confined to a mental institution since Michael's last attempt to slay her. Suspecting a psychic link between Michael and Jamie, psychiatrist Dr. Sam Loomis (Donald Pleasence) joins forces with Sheriff Ben Meeker (Beau Starr) and attempts to stop Michael's latest rampage.", Year = 1989, IsForeign = false, Length = "97min", Rating = "3.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Peacock, AMC" },
                new Movie {Id = 197, DirectorId = 1, GenreId = 5, Title = "Halloween: The Curse of Michael Myers", Description = "This installment marks the return of the seemingly indestructible masked murderer Michael Myers (George P. Wilbur), who is targeting Tommy Doyle (Paul Stephen Rudd), a young man tied into the legacy of the killer and his connections with the Strode family. As the supernatural elements of Michael's macabre abilities are explored, his longtime adversary, Dr. Sam Loomis (Donald Pleasence), is also back in yet another attempt to stop the psychopath's brutal rampages.", Year = 1995, IsForeign = false, Length = "96min", Rating = "3.6/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Peacock, AMC" },
                new Movie {Id = 198, DirectorId = 134, GenreId = 5, Title = "Halloween H20: 20 Years Later", Description = "Two decades after surviving a massacre on October 31, 1978, former baby sitter Laurie Strode (Jamie Lee Curtis) finds herself hunted by persistent knife-wielder Michael Myers. Laurie now lives in Northern California under an assumed name, where she works as the headmistress of a private school. But it's not far enough to escape Myers, who soon discovers her whereabouts. As Halloween descends upon Laurie's peaceful community, a feeling of dread weighs upon her -- with good reaso", Year = 1998, IsForeign = false, Length = "96min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Peacock, AMC" },
                new Movie {Id = 199, DirectorId = 135, GenreId = 5, Title = "Halloween", Description = "Nearly two decades after being committed to a mental institution for killing his stepfather and older sister, Michael Myers breaks out, intent on returning to the town of Haddonfield, Ill. He arrives in his hometown on Halloween with the indomitable purpose of hunting down his younger sister, Laurie. The only thing standing between Michael and a Halloween night of bloody carnage is psychologist Dr. Samuel Loomis.", Year = 2007, IsForeign = false, Length = "121min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Peacock, AMC" },
                new Movie {Id = 200, DirectorId = 135, GenreId = 5, Title = "Halloween II", Description = "A year after narrowly escaping death at the hands of Michael Myers (Tyler Mane), Laurie Strode is at the breaking point, pushed to the edge by Dr. Loomis' (Malcolm McDowell) revelation that she's Michael's sister. Little does she know, the unstoppable killer is back in Haddonfield and, driven by visions of their dead mother (Sheri Moon Zombie), he is determined to bring about a bloody family reunion.", Year = 2009, IsForeign = false, Length = "101min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime, FuboTV, Sling TV, AMC" },
                new Movie {Id = 201, DirectorId = 13, GenreId = 5, Title = "Halloween", Description = "It's been 40 years since Laurie Strode survived a vicious attack from crazed killer Michael Myers on Halloween night. Locked up in an institution, Myers manages to escape when his bus transfer goes horribly wrong. Laurie now faces a terrifying showdown when the masked madman returns to Haddonfield, Ill. -- but this time, she's ready for him.", Year = 2018, IsForeign = false, Length = "109min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime, FuboTV, Sling TV, AMC" },
                new Movie {Id = 202, DirectorId = 13, GenreId = 5, Title = "Halloween Kills", Description = "The nightmare isn't over as unstoppable killer Michael Myers escapes from Laurie Strode's trap to continue his ritual bloodbath. Injured and taken to the hospital, Laurie reunites with Tommy Doyle, the boy she was babysitting on the night Michael began his reign of terror. As Laurie continues to fight through the pain, Tommy leads an angry mob of vigilantes to rise up against Myers and destroy the evil once and for all.", Year = 2021, IsForeign = false, Length = "106min", Rating = "2.8/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Hulu, Showtime, FuboTV, Sling TV, AMC" },
                new Movie {Id = 203, DirectorId = 13, GenreId = 5, Title = "Halloween Ends", Description = "Four years after her last encounter with masked killer Michael Myers, Laurie Strode is living with her granddaughter and trying to finish her memoir. Myers hasn't been seen since, and Laurie finally decides to liberate herself from rage and fear and embrace life. However, when a young man stands accused of murdering a boy that he was babysitting, it ignites a cascade of violence and terror that forces Laurie to confront the evil she can't control.", Year = 2022, IsForeign = false, Length = "111min", Rating = "1.9/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox" },
                new Movie {Id = 204, DirectorId = 125, GenreId = 5, Title = "Freddy vs. Jason", Description = "Two horror icons face off in this supernatural movie. Disfigured serial killer Freddy Krueger (Robert Englund), who attacks his victims in their dreams, has lost much of his power since citizens of his town have become less afraid of him. Enlisting the help of fellow violent murderer Jason Voorhees (Ken Kirzinger), Freddy orchestrates a new killing spree. However, when the hockey-mask-wearing psychopath won't stop chopping up Freddy's intended victims, the two ghouls start to battle each other.", Year = 2003, IsForeign = false, Length = "98min", Rating = "4.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max" },
                new Movie {Id = 205, DirectorId = 136, GenreId = 5, Title = "A Nightmare on Elm Street", Description = "In Wes Craven's classic slasher film, several Midwestern teenagers fall prey to Freddy Krueger (Robert Englund), a disfigured midnight mangler who preys on the teenagers in their dreams -- which, in turn, kills them in reality. After investigating the phenomenon, Nancy (Heather Langenkamp) begins to suspect that a dark secret kept by her and her friends' parents may be the key to unraveling the mystery, but can Nancy and her boyfriend Glen (Johnny Depp) solve the puzzle before it's too late?", Year = 1984, IsForeign = false, Length = "91min", Rating = "4.3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Sling TV" },
                new Movie {Id = 206, DirectorId = 136, GenreId = 5, Title = "Wes Craven's New Nightmare", Description = "Reality and fantasy meet in unsettling ways in this installment of the long-running horror series, which finds director Wes Craven and actors Heather Langenkamp and Robert Englund all portraying themselves. As Heather (Heather Langenkamp) considers making another film with Craven, her son, Dylan (Miko Hughes), falls under the spell of the iconic disfigured villain Freddy Krueger (Robert Englund). Eventually, Langenkamp must confront Freddy's demonic spirit to save the soul of Dylan", Year = 1994, IsForeign = false, Length = "112min", Rating = "4.1/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Sling TV" },
                new Movie {Id = 207, DirectorId = 137, GenreId = 5, Title = "Freddy's Dead: The Final Nightmare", Description = "Murderous ghoul Freddy Krueger (Robert Englund) has slaughtered every last child in his hometown. He ventures on to a new location, scouting fresh young victims to hack up with his finger blades. He arrives in a small town in which his long-lost daughter, Maggie (Lisa Zane), works as a therapist for troubled youths. He attempts to recruit her for his dastardly pursuits, but she has other ideas. Father and daughter meet for a bloody showdown that will determine Freddy's fate once and for all.", Year = 1991, IsForeign = false, Length = "93min", Rating = "2.9/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Sling TV" },
                new Movie {Id = 208, DirectorId = 138, GenreId = 10, Title = "Never Sleep Again: The Elm Street Legacy", Description = "Never Sleep Again: The Elm Street Legacy is a 2010 American direct-to-video documentary film that chronicles the entire Nightmare on Elm Street franchise, except for the 2010 remake. The documentary also explores the rise of New Line Cinema.", Year = 2010, IsForeign = false, Length = "240min", Rating = "4.5/5", Rated = "Not Rated", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Tubi, Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 209, DirectorId = 139, GenreId = 6, Title = "Miracle on 34th Street", Description = "In this Christmas classic, an old man going by the name of Kris Kringle (Edmund Gwenn) fills in for an intoxicated Santa in Macy's annual Thanksgiving Day parade. Kringle proves to be such a hit that he is soon appearing regularly at the chain's main store in midtown Manhattan. When Kringle surprises customers and employees alike by claiming that he really is Santa Claus, it leads to a court case to determine his mental health and, more importantly, his authenticity.", Year = 1947, IsForeign = false, Length = "101min", Rating = "4.8/5", Rated = "G", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Disnet+" },
                new Movie {Id = 210, DirectorId = 140, GenreId = 7, Title = "Home Alone", Description = "When bratty 8-year-old Kevin McCallister (Macaulay Culkin) acts out the night before a family trip to Paris, his mother (Catherine O'Hara) makes him sleep in the attic. After the McCallisters mistakenly leave for the airport without Kevin, he awakens to an empty house and assumes his wish to have no family has come true. But his excitement sours when he realizes that two con men (Joe Pesci, Daniel Stern) plan to rob the McCallister residence, and that he alone must protect the family home.", Year = 1978, IsForeign = false, Length = "103min", Rating = "4.8/5", Rated = "PG", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, STARZ" },
                new Movie {Id = 211, DirectorId = 77, GenreId = 8, Title = "Jurassic Park", Description = "In Steven Spielberg's massive blockbuster, paleontologists Alan Grant (Sam Neill) and Ellie Sattler (Laura Dern) and mathematician Ian Malcolm (Jeff Goldblum) are among a select group chosen to tour an island theme park populated by dinosaurs created from prehistoric DNA. While the park's mastermind, billionaire John Hammond (Richard Attenborough), assures everyone that the facility is safe, they find out otherwise when various ferocious predators break free and go on the hunt.", Year = 1990, IsForeign = false, Length = "103min", Rating = "4.7/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube, Redbox, Max, Sling TV, Hulu, Peacock" },
                new Movie {Id = 212, DirectorId = 141, GenreId = 9, Title = "Tombstone", Description = "Wyatt Earp (Kurt Russell) and his brothers, Morgan (Bill Paxton) and Virgil (Sam Elliott), have left their gunslinger ways behind them to settle down and start a business in the town of Tombstone, Ariz. While they aren't looking to find trouble, trouble soon finds them when they become targets of the ruthless Cowboy gang. Now, together with Wyatt's best friend, Doc Holliday (Val Kilmer), the brothers pick up their guns once more to restore order to a lawless land.", Year = 1993, IsForeign = false, Length = "134min", Rating = "4.7/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Amazon Prime, Vudu, Google Play Movies & TV, YouTube" },
                new Movie {Id = 213, DirectorId = 142, GenreId = 10, Title = "The Trial of the Chicago 7", Description = "The film is based on the infamous 1969 trial of seven defendants charged by the federal government with conspiracy and more, arising from the countercultural protests in Chicago at the 1968 Democratic National Convention. The trial transfixed the nation and sparked a conversation about mayhem intended to undermine the U.S. government.", Year = 2020, IsForeign = false, Length = "129min", Rating = "4.8/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Netflix" },
